import React, { useState } from "react";
import { Table, Button } from "antd";

const DynamicTable = () => {
  const [dataSource, setDataSource] = useState([
    { key: "1", name: "Velocidade", sub1: "", sub2: "", tolerancia: "" },
    { key: "2", name: "Lim. Pressão", sub1: "", sub2: "", tolerancia: "" },
  ]);

  const [columns, setColumns] = useState([
    { title: "Etapa1 Pressão", dataIndex: "name", key: "name" },
  ]);

  const handleAddRow = () => {
    setDataSource((prevDataSource) => [
      ...prevDataSource,
      {
        key: String(prevDataSource.length + 1),
        name: `Padrão ${prevDataSource.length + 1}`,
        sub1: "",
        sub2: "",
        tolerancia: "",
      },
    ]);
  };

  const handleAddColumn = () => {
    setColumns((prevColumns) => [
      ...prevColumns,
      {
        title: `Coluna ${prevColumns.length}`,
        dataIndex: `column${prevColumns.length}`,
        key: `column${prevColumns.length}`,
      },
    ]);
  };

  const handleDeleteRow = (key) => {
    setDataSource((prevDataSource) =>
      prevDataSource.filter((row) => row.key !== key)
    );
  };

  const handleDeleteColumn = (column) => {
    if (column.key === "tolerancia") {
      return;
    }
    setColumns((prevColumns) =>
      prevColumns.filter((col) => col.key !== column.key)
    );
  };

  const handleRowDataChange = (key, field, newValue) => {
    setDataSource((prevDataSource) =>
      prevDataSource.map((row) => {
        if (row.key === key) {
          return {
            ...row,
            [field]: newValue,
          };
        }
        return row;
      })
    );
  };

  const handleColumnDataChange = (columnKey, newData) => {
    setColumns((prevColumns) =>
      prevColumns.map((column) => {
        if (column.key === columnKey) {
          return {
            ...column,
            ...newData,
          };
        }
        return column;
      })
    );
  };

  const renderDeleteRowButton = (key) => {
    if (dataSource.length <= 2) {
      return null;
    }
    return (
      <Button type="link" onClick={() => handleDeleteRow(key)}>
        Delete
      </Button>
    );
  };

  const renderDeleteColumnButton = (column) => {
    if (column.key === "tolerancia") {
      return null;
    }
    return (
      <Button type="link" onClick={() => handleDeleteColumn(column)}>
        Delete
      </Button>
    );
  };

  return (
    <>
      <Button type="primary" onClick={handleAddRow}>
        Add Row
      </Button>
      <Button type="primary" onClick={handleAddColumn}>
        Add Column
      </Button>
      <Table
        dataSource={dataSource}
        columns={columns.map((column) => ({
          ...column,
          render: (_, row) => {
            const columnKey = column.key;
            if (columnKey === "name") {
              return row[columnKey];
            } else if (columnKey === "tolerancia") {
              return null;
            } else {
              return (
                <>
                  <input
                    style={{ width: "50px", height: "30px", margin: "5px 0" }}
                    value={row[columnKey]}
                    onChange={(e) =>
                      handleRowDataChange(row.key, columnKey, e.target.value)
                    }
                  />
                  {renderDeleteRowButton(row.key)}
                </>
              );
            }
          },
        }))}
        bordered
        pagination={false}
        scroll={{ x: 800, y: 400 }}
        components={{
          header: {
            cell: (props) => {
              const columnKey = props.column.key;
              if (columnKey === "name") {
                return <th {...props}></th>;
              } else if (columnKey === "tolerancia") {
                return (
                  <th {...props}>
                    <div style={{ height: "30px" }}>
                      Tolerância <br /> (±)
                    </div>
                  </th>
                );
              } else {
                return (
                  <th {...props}>
                    <div>
                      <input
                        style={{ width: "70px", height: "30px" }}
                        value={props.column.title}
                        onChange={(e) =>
                          handleColumnDataChange(props.column.key, {
                            title: e.target.value,
                          })
                        }
                      />
                      {renderDeleteColumnButton(props.column)}
                    </div>
                  </th>
                );
              }
            },
          },
        }}
      />
    </>
  );
};

export default DynamicTable;
